"use strict";function initOfficeMap(){var e,t=document.getElementById("officeMap"),o=t.dataset,n={lat:Number(o.lat),lng:Number(o.lng)},m=Number(o.zoom);e=new google.maps.Map(t,{center:n,zoom:m});new google.maps.Marker({position:n,map:e});google.maps.event.addDomListener(window,"resize",function(){var t=document.documentElement.clientWidth;setTimeout(function(){e.setCenter(n),t<768?e.setZoom(m-2):e.setZoom(m)},500)})}